test foo(array [int] of var opt int: x, int: y) = true;
test foo(array [int] of var int: x, set of int: y) = false;
constraint foo([_, _], 1); Bottom up typing will be unable to determine a type for the [_, _] literal. In this case, since second argument of the call is an int, only the first overload of foo is possible. Therefore the type should be array [int] of var opt int.
